window.bookSummaryJSON = "<p>My name is Vinna, and my magic is an asshole.&nbsp;</p> <p>I mean, what else would you call it when it does whatever it wants, whenever it wants?&nbsp;</p> <p>Now I have Enoch and his coven looking at me like I'm the one, and a bunch of pissed-off Chosen.&nbsp;</p> <p>I have no answers and no time to deal with this shit. Lachlan and Keegan managed to get themselves caught by Adriel, the big bad lamia who murders and hunts Sentinels.&nbsp;</p> <p>Time is running out, and if my Chosen and I can't get battle ready, then we're destined to become more names on the list of the missing.&nbsp;</p> <p>It's time to meet the lamia who's been coming for me my whole life. It's time to do what no one else has been able to do. It's time to cut the f--ker's head off.&nbsp;</p> <p><b>Contains mature themes.</b></p>"; 
